import React, { useState } from 'react';
import ReactMapGL from 'react-map-gl';

export default function MapBox(props) {
    let location = props.location;

    const [viewport, setViewport] = useState({
        width: '85%',
        height: 400,
        latitude: 43.637371,
        longitude: -79.457981,
        zoom: 3,
      });

    return (
        <ReactMapGL {...viewport} mapboxApiAccessToken={'pk.eyJ1Ijoic2VhbnBvbGxvY2siLCJhIjoiY2toZHV5MnRkMGM0ajJ4cGoxeGJjeHdmaCJ9.s6rqIVazeUxiBYVry-xefQ'}
        onViewportChange={(viewport)}>

        </ReactMapGL>
    )
}
